import React, { useEffect,useState }  from "react";
import axios from "axios";

function User() {
  const[data, setData]= useState([])
  useEffect(()=>{
    axios.get('http://127.0.0.1:8000/users/')
    .then(res => setData(res.data))
    .catch(err => console.error(err));
    },[])
    return(
      <div></div>
    )
}
export default Users
